import React from 'react';
import Proptypes from 'prop-types';

const Today =({today})=>{

    return(
        <div>
            <h1>Today`s Schedule</h1>
            <h2>{today}</h2>
        </div>
    )
}

Today.proptypes = {
    today: Proptypes.string.isRequired,
}

export default Today;
